import React from 'react';
import ReactDOM from 'react-dom';
import {Btn} from "./components/styles/Buttons.jsx"

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <Btn>
                    click me
                </Btn>
            </header>
        </div>
    );
}

export default App;
